import React, { useState } from 'react';
import Navigation from './components/Navigation';
import HomePage from './pages/HomePage';
import AboutUs from './pages/AboutUs';
import IntakeForms from './pages/IntakeForms';
import StudentRegistrationForm from './pages/forms/StudentRegistrationForm';
import ThriveIntakeForm from './pages/forms/ThriveIntakeForm';
import CommunityIntakeForm from './pages/forms/CommunityIntakeForm';
import DSHSConsentForm from './pages/forms/DSHSConsentForm';
import CulturalIntegrationProgram from './pages/forms/CulturalIntegrationProgram';
import SoccerCampRegistration from './pages/forms/SoccerRegistrationCamp';
import EpiscopalPreferredCommunitiesIntakeForm from './pages/forms/EpiscopalPreferredCommunitiesIntakeForm';
import PCGAPRegistrationForm from './pages/forms/PCGAPRegistrationForm'; // Import the new form

export type PageType =
  | 'home'
  | 'intake'
  | 'about'
  | 'studentRegistration'
  | 'thriveIntake'
  | 'communityIntake'
  | 'dshsConsent'
  | 'culturalIntegration'
  | 'soccerCamp'
  | 'episcopalPreferredCommunities'
  | 'pcGapRegistration'; // Add the new page type

const App: React.FC = () => {
  const [currentPage, setCurrentPage] = useState<PageType>('home');

  const renderPage = (): JSX.Element => {
    switch (currentPage) {
      case 'home':
        return <HomePage />;
      case 'intake':
        return <IntakeForms setCurrentPage={setCurrentPage} />;
      case 'about':
        return <AboutUs />;
      case 'studentRegistration':
        return <StudentRegistrationForm />;
      case 'thriveIntake':
        return <ThriveIntakeForm />;
      case 'communityIntake':
        return <CommunityIntakeForm />;
      case 'dshsConsent':
        return <DSHSConsentForm />;
      case 'culturalIntegration':
        return <CulturalIntegrationProgram />;
      case 'soccerCamp':
        return <SoccerCampRegistration />;
      case 'episcopalPreferredCommunities':
        return <EpiscopalPreferredCommunitiesIntakeForm />;
      case 'pcGapRegistration': // Add the new case
        return <PCGAPRegistrationForm />;
      default:
        return <HomePage />;
    }
  };

  return (
    <div className="font-sans">
      <Navigation setCurrentPage={setCurrentPage} />
      {renderPage()}
    </div>
  );
};

export default App;
